import React from 'react';
import s from './BigProjects.module.css';

function BigProjects(props) {

    return (
        <div className={s.body}>
            <p>BigProjects</p>
            <p>SOME STARTUPS AND COMPANIES THAT I HELPED TO CREATE THEIR TECH</p>
            {/* styles of bigProject's cart*/}
            <div className={s.cart}>
                <img src="" alt="" />
                <span>itWorld</span>
                <span></span>
            </div>
        </div>
    );
}

export default BigProjects;
